import React from 'react';

const PostList = () => {
    return(
        <>
            <div className="Post_top">
                <div className="array_tab">
                    <button type="button" className="tab_button on">전체글</button>
                    <button type="button" className="tab_button">개념글</button>
                </div>
            </div>
            <div className="Post_bottom">
                    <table className="tip_list">
                        <colgroup>
                            <col style="width:6%"/>
                            <col style="width:6%"/>
                            <col/>
                            <col style="width:18%"/>
                            <col style="width:6%"/>
                            <col style="width:6%"/>
                            <col style="width:6%"/>
                        </colgroup>
                        <tr>
                            <th scope="col">챔피언</th>
                            <th scope="col">번호</th>
                            <th scope="col">제목</th>
                            <th scope="col">글쓴이</th>
                            <th scope="col">작성일</th>
                            <th scope="col">조회</th>
                            <th scope="col">추천</th>
                        </tr>
                    </table>
            </div>
            <style jsx global>
                {`
                    .Post_top {
                        width: 1000px;
                        margin: 0 auto;
                    }
                    .array_tab {
                        margin-top: 30px;
                        width: 250px;
                        height: 32px;
                    }
                    .tab_button {
                        width: 82px;
                        height: 32px;
                        border: 1px solid #ccc;
                        border-radius: 2px;
                        font-size: 14px;
                        font-weight: bold;
                        color: #333;
                        margin-right: 5px;
                    }
                    .tab_button.on{
                        border: 1px solid #3c4790;
                        background: #4a57a8;
                        color: #fff;
                        text-shadow: 0px -1px #343d8e;
                    }
                `}
            </style>
        </>
    )
}

export default PostList;
